INSERT INTO `v9_news_data` (`id`, `content`, `readpoint`, `groupids_view`, `paginationtype`, `maxcharperpage`, `template`, `paytype`, `relation`, `voteid`, `allow_comment`, `copyfrom`) VALUES
(36, '&nbsp;&nbsp;<span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">柠檬性喜温暖，耐阴，不耐寒，也怕热，因此，适宜在冬暖夏凉的亚热带地区栽培。柠檬适宜的年平均气温17-19℃，年有效积温（&ge;10℃）在5500℃以上，1月平均气温6-8℃，极端最低温高于-3℃；年降雨量1000毫米以上，年日照时数1000小时以上。柠檬适宜栽植于温暖而土层深厚、排水良好的缓坡地，柠檬最适宜土壤pH值是5.5-7.0之间。柠檬植株生长较快，植株高达3-6米，需肥量较大，一年多次抽梢、开花、结果，常因管理好坏而产量差异较大。</span>', 0, '', 0, 10000, '', 0, '', 0, 1, '|0'),
(35, '<span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">橙子的生长发育、开花结果与温度、日照、水分(湿度)、土壤以及风、海拔、地形和坡向等环境条件紧密相关，这些条件影响最大的数温度。即使差异℃的气温有时也会出现截然不同的结果。最适宜橙子生长的温度为～37℃。秋季花芽分化时，要求昼夜温度分别为20℃左右和10℃左右，过低的温度会使橙子受冻。另外，橙子是耐阴性较强的树种，但要优质丰产仍需好的日照。一般年日照时数1200～2200小时的地区均能正常生长</span><br />\r\n<br />\r\n', 0, '', 0, 10000, '', 0, '', 0, 1, '|0'),
(29, '&nbsp; &nbsp;<span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">苹果是喜光树种，光照充足，始能生长正常。据山东农大测定，</span><a href="http://baike.baidu.com/view/9481.htm" style="color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;" target="_blank">泰安</a><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">地区金冠、新红星，光 照补偿点为600～800米</span><a href="http://baike.baidu.com/subview/78643/9291381.htm" style="color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;" target="_blank">烛光</a><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">，饱和点在3500～4500米烛光。在此范围内光照强度增加，光合作用也加强。日照不足，则引起一系列反应，如</span><a href="http://baike.baidu.com/view/2921981.htm" style="color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;" target="_blank">枝叶</a><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">徒长、软弱、抗病虫力差，花芽分化少，营养贮存少，开花座果率低，根系生长也受影响，果实含糖量低，上色也不好。</span>', 0, '', 0, 10000, '', 0, '', 0, 1, '|0'),
(30, '&nbsp; &nbsp;<span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">选择面粉的时候，我们所要得到的信息是高精粉</span><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">、中筋粉和低精粉</span><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">等不同产品的分类或者表示面粉纯度的等级，以及矿物质，粗蛋白等含量的表示。很多人在购买面粉的时候会误以为&ldquo;高精面粉</span><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">=高精面粉&rdquo;，其实&ldquo;高精&rdquo;的意思简单说就是高级精制，它只表示小麦的加工工艺，并不能说明面粉的精度</span><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">，所以&ldquo;高级精制&rdquo;的可能是高筋面粉，也可能是低筋面粉，可能是特等粉，也可能是二等粉。由此看来，&ldquo;高精&rdquo;的说法其实是不科学</span><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">的，至少不是行业标准用语，所以，建议在选购面粉</span><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">时，应该注意的是其蛋白质含量，即筋度，而非&ldquo;高级精制&rdquo;。</span>', 0, '', 0, 10000, '', 0, '', 0, 1, '|0'),
(31, '&nbsp;&nbsp;<span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">三文鱼中含有丰富的不饱和脂肪酸，能有效降低血脂和血胆固醇，防治心血管疾病，每周两餐，就能将受心脏病攻击死亡的概率降低三分之一。鲑鱼还含有一种叫做虾青素的物质，是一种非常强力的</span><a href="http://baike.baidu.com/view/53375.htm" style="color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;" target="_blank">抗氧化剂</a><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">。</span><span style="font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; white-space: nowrap; margin-left: 2px; color: rgb(51, 102, 204); cursor: default; padding: 0px 2px; font-family: arial, 宋体, sans-serif; text-indent: 28px;">[1]</span><a class="sup-anchor" name="ref_[1]_44684" style="color: rgb(19, 110, 194); position: relative; top: -50px; font-size: 0px; line-height: 0; font-family: arial, 宋体, sans-serif; text-indent: 28px; background-color: rgb(255, 255, 255);">&nbsp;</a><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">&nbsp;其所含的&Omega;-3脂肪酸更是脑部、视网膜及神经系统所必不可少的物质，有增强脑功能、防止</span><a href="http://baike.baidu.com/view/53909.htm" style="color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;" target="_blank">老年痴呆</a><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">和预防视力减退的功效；</span>', 0, '', 0, 10000, '', 0, '', 0, 1, '|0'),
(32, '&nbsp;&nbsp;<span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">芥花籽油因可减少患冠心病风险的能力而有资格获得美国食品及药物管理局一项合格健康声明。芥花籽油具有较高的健康不饱和脂肪含量（93%）、不含胆固醇和反式脂肪且拥有最低的饱和脂肪含量（7%），高耐热性、烟点高，在215&deg;C高温下无油烟、大众化口味和轻而均匀的组织，适合中国家庭爆炒、油炸等烹饪方式。</span>', 0, '', 0, 10000, '', 0, '', 0, 1, '|0'),
(33, '&nbsp;&nbsp;<span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">有机食品在生产加工过程中绝对禁止使用农药、化肥、激素等人工合成物质，并且不允许使用基因工程技术。有机食品在土地生产转型方面有严格规定，土地从生产其他食品到生产有机食品需要两到三年的转换期。有机食品需要建立一个全新完整的生产体系、监控体系和追溯体系。有机食品比绿色食品要求更严、档次更高。有机食品对大气、水土等生产地的要求更严格。</span>', 0, '', 0, 10000, '', 0, '', 0, 1, '|0'),
(34, '&nbsp;&nbsp;<span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">生态果蔬是按照全球</span><a href="http://baike.baidu.com/subview/2267731/2267731.htm" style="color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;" target="_blank">良好农业规范</a><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">(GAP)及有机食品标准生产，精选优良品种通过科学育种、育苗，采用有机生态栽培、物理贮存保鲜等</span><a href="http://baike.baidu.com/subview/1487851/1487851.htm" style="color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;" target="_blank">现代农业技术</a><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">，提升果蔬品质，使果蔬产品</span><a href="http://baike.baidu.com/subview/1999380/12505227.htm" style="color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;" target="_blank">回归自然</a><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">生态，富含有益健康的维生素、微量</span><a href="http://baike.baidu.com/subview/880051/880051.htm" style="color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;" target="_blank">矿物元素</a><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">、蛋白质、</span><a href="http://baike.baidu.com/subview/11678437/12040093.htm" style="color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;" target="_blank">胺基酸</a><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;">等营养成分，同时，不使用化肥农药及化学工艺方法，无化肥农药等有毒、有害物质残留，实现了&ldquo;优良品种、绿色无害、健康营养&rdquo;的完美统一，堪称&ldquo;果蔬珍品&rdquo;。</span>', 0, '', 0, 10000, '', 0, '', 0, 1, '|0'),
